'use strict';

angular.module('pace.layout')
    .service('FilmstripTourUtilsService', ['$rootScope', '$timeout', 'TourService', function DesignerOverviewTourService($rootScope, $timeout, TourService) {

        var maxSampleImages = 7;

        return {
            populateFilmstrip: populateFilmstrip,
            clearFilmstrip: clearFilmstrip,
            getSelectedItems: getSelectedItems,
            selectFilmstripItems: selectFilmstripItems,
            deselectFilmstripItems: deselectFilmstripItems
        };

        function populateFilmstrip(layoutController, layout) {
            TourService.disableTourButton(true);

            $timeout(function() {
                var sampleImagesCount = maxSampleImages;
                var i = layout.filmStrip.items.length;

                // check if we already have any sample items in filmstrip
                while (i--) {
                    if (layout.filmStrip.items[i].image.filename.indexOf('tour-sample-') !== -1) {
                        sampleImagesCount--;
                    }
                }

                if (sampleImagesCount > 0) {
                    for (i = 0; i < sampleImagesCount; i++) {
                        layout.filmStrip.items.unshift(createSampleImage(i + 1));
                    }

                    layoutController.fireEvent('layout:layout-changed');
                    layoutController.fireEvent('layout:filmstrip-changed');
                }

                TourService.disableTourButton(false);
            }, 1000);
        }

        function clearFilmstrip(layoutController, layout) {
            var i = layout.filmStrip.items.length;
            var items = [];

            while (i--) {
                if (layout.filmStrip.items[i].image.filename.indexOf('tour-sample-') !== -1) {
                    items.push(layout.filmStrip.items[i]);
                }
            }

            var cmd = new PACE.RemoveFilmstripItemsCommand(
                layout.filmStrip.items,
                layout,
                items);
            cmd.execute();

            layoutController.renderAll();
            layoutController.fireEvent('layout:layout-changed');
            layoutController.fireEvent('layout:filmstrip-changed');
        }

        function getSelectedItems(layout) {
            var i = layout.filmStrip.items.length;
            var items = [];

            while (i--) {
                if (layout.filmStrip.items[i].image.filename.indexOf('tour-sample-') !== -1) {
                    items.push(layout.filmStrip.items[i]);
                }
            }

            return items;
        }

        function selectFilmstripItems() {
            deselectFilmstripItems();

            var filmstrip = document.getElementById('filmstrip-container');
            var filmstripItems = filmstrip.getElementsByClassName('filmstrip-item');
            var filmstripActiveItems = filmstrip.getElementsByClassName('filmstrip-item active');
            var leftToSelect = Math.min(filmstripItems.length, maxSampleImages) - filmstripActiveItems.length;
            var mouseDownEvent = new MouseEvent('mousedown', {bubbles: true, cancelable: true, view: window, ctrlKey: true});

            for (var i = 0; i < filmstripItems.length; i++) {
                var el = filmstripItems[i];

                if (leftToSelect > 0 && !el.classList.contains('active')) {
                    el.dispatchEvent(mouseDownEvent);
                    leftToSelect--;
                }
            }
        }

        function deselectFilmstripItems() {
            var filmstrip = document.getElementById('filmstrip-container');
            var filmstripItems = filmstrip.getElementsByClassName('filmstrip-item');
            var mouseDownEvent = new MouseEvent('mousedown', {bubbles: true, cancelable: true, view: window, ctrlKey: true});

            for (var i = 0; i < filmstripItems.length; i++) {
                var el = filmstripItems[i];

                if (el.classList.contains('active')) {
                    el.dispatchEvent(mouseDownEvent);
                }
            }
        }

        function createSampleImage(imageNo) {
            return {
                id: null,
                image: {
                    colorSpace: 'RGB',
                    creationDate: '2013-12-24T09:52:49Z',
                    customIccProfile: null,
                    dataPrecision: 8,
                    dpiX: 300,
                    dpiY: 300,
                    errorMessage: null,
                    file: {
                        name: 'tour-sample-00' + imageNo + '.jpg',
                        lastModified: 1387878769000,
                        lastModifiedDate: new Date(1387878769000),
                        size: 3084013,
                        type: 'image/jpeg',
                        webkitRelativePath: ''
                    },
                    filename: 'tour-sample-00' + imageNo + '.jpg',
                    getLowResUrl: function() { return '/images/tour-sample-assets/tour-sample-00' + imageNo + '.jpg'; },
                    getOriginalUrl: function() { return '/images/tour-sample-assets/tour-sample-00' + imageNo + '.jpg'; },
                    getThumbnailUrl: function() { return '/images/tour-sample-assets/tour-sample-00' + imageNo + '-thumb.jpg'; },
                    height: getSampleImageHeight(imageNo),
                    iccProfile: 'ProPhoto RGB',
                    id: null,
                    imageHeight: getSampleImageHeight(imageNo),
                    imageWidth: getSampleImageWidth(imageNo),
                    isBlackAndWhite: null,
                    lowResImageUrl: 'tour-sample-00' + imageNo + '.jpg',
                    numComponents: 3,
                    orientation: 1,
                    originalImageUrl: 'tour-sample-00' + imageNo + '.jpg',
                    progress: 100,
                    rating: 0,
                    replace: false,
                    size: 3084013,
                    status: 'New',
                    targetIccProfile: null,
                    thumbImageUrl: 'tour-sample-00' + imageNo + '-thumb.jpg',
                    thumbnailAsBase64: getSampleImageBase64(imageNo),
                    type: 'ImageFile',
                    url: 'tour-sample-00' + imageNo + '.jpg',
                    user: {},
                    version: 2,
                    width: getSampleImageWidth(imageNo),
                    _id: _.uniqueId('imageFile') + _.now()
                },
                occurrences: [],
                type: 'FilmStripImageItem',
                version: 1,
                _id: _.uniqueId('filmstrip-item-') + _.now()
            };
        }

        function getSampleImageBase64(imageNo) {
            switch (imageNo) {
                case 1:
                    return 'data:image/jpeg;base64,';
                case 2:
                    return 'data:image/jpeg;base64,';
                case 3:
                    return 'data:image/jpeg;base64,';
                case 4:
                    return 'data:image/jpeg;base64,';
                case 5:
                    return 'data:image/jpeg;base64,';
                case 6:
                    return 'data:image/jpeg;base64,';
                case 7:
                    return 'data:image/jpeg;base64,';
                default:
                    return '';
            }
        }

        function getSampleImageWidth(imageNo) {
            switch (imageNo) {
                case 1:
                    return 4149;
                case 2:
                    return 3675;
                case 3:
                    return 3757;
                case 4:
                    return 4256;
                case 5:
                    return 2832;
                case 6:
                    return 4256;
                case 7:
                    return 3504;
            }
        }

        function getSampleImageHeight(imageNo) {
            switch (imageNo) {
                case 1:
                    return 2761;
                case 2:
                    return 2525;
                case 3:
                    return 2500;
                case 4:
                    return 2832;
                case 5:
                    return 4256;
                case 6:
                    return 2832;
                case 7:
                    return 2328;
            }
        }

    }]);
